import React from 'react';
import PropTypes from 'prop-types';

export default class ButtonPanel extends React.Component {
    static propTypes = {
        clickHandler: PropTypes.func,
    };

    render() {
        return (
            <div className='componet-button-panel'></div>
        );
    }
}
